  selector: 'app-vision',
  templateUrl: './vision.component.html',
  styleUrls: ['./vision.component.scss']
})
export class VisionComponent {
  blogs = [
    {imageUrl: '../assets/images/blogs/gfg1.jpg',  title: 'In Top 50 on GeeksForGeeks LeaderBoard!', content: 'My Portfolio Deployment Method!'},
  ];
}
<div class="vision-header">
